import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MatSnackBar } from '@angular/material/snack-bar';
import { ActivatedRoute, Router } from '@angular/router';
import { SessionService } from '../../../../services/session.service';
import { TeacherService } from '../../../../services/teacher.service';
import { Session } from '../../interfaces/session.interface';
import { SessionApiService } from '../../services/session-api.service';

@Component({
  selector: 'app-form',
  templateUrl: './form.component.html',
  styleUrls: ['./form.component.scss'],
})
export class FormComponent implements OnInit {
  public onUpdate: boolean = false;
  public sessionForm: FormGroup | undefined;
  public teachers$ = this.teacherService.all();
  private id: string | undefined;

  constructor(
    private route: ActivatedRoute,
    private fb: FormBuilder,
    private matSnackBar: MatSnackBar,
    private sessionApiService: SessionApiService,
    private sessionService: SessionService,
    private teacherService: TeacherService,
    private router: Router
  ) {}

  public ngOnInit(): void {
    console.log(
      'form sessionInformation',
      this.sessionService.sessionInformation
    );
    if (!this.sessionService.sessionInformation!.admin) {
      this.router.navigate(['/sessions']);
    }
    const url = this.router.url;
    if (url.includes('update')) {
      this.onUpdate = true;
      this.id = this.route.snapshot.paramMap.get('id')!;
      this.sessionApiService
        .detail(this.id)
        .subscribe((session: Session) => this.initForm(session));
    } else {
      this.initForm();
    }
  }

  public submit(): void {
    const session = this.sessionForm?.value as Session;

    if (!this.onUpdate) {
      this.sessionApiService
        .create(session)
        .subscribe((_: Session) => this.exitPage('Session created !'));
    } else {
      this.sessionApiService
        .update(this.id!, session)
        .subscribe((_: Session) => this.exitPage('Session updated !'));
    }
  }

  private initForm(session?: Session): void {
    this.sessionForm = this.fb.group({
      name: [session ? session.name : '', [Validators.required]],
      date: [
        session ? new Date(session.date).toISOString().split('T')[0] : '',
        [Validators.required],
      ],
      teacher_id: [session ? session.teacher_id : '', [Validators.required]],
      description: [
        session ? session.description : '',
        [Validators.required, Validators.maxLength(2000)],
      ],
    });
  }

  private exitPage(message: string): void {
    this.matSnackBar.open(message, 'Close', { duration: 3000 });
    this.router.navigate(['sessions']);
  }
}
<div class="create m3">
  <mat-card>
    <mat-card-title>
      <div fxLayout="row" fxLayoutAlign="start center">
        <button mat-icon-button routerLink="/sessions">
          <mat-icon>arrow_back</mat-icon>
        </button>
        <h1 *ngIf="!onUpdate">Create session</h1>
        <h1 *ngIf="onUpdate">Update session</h1>
      </div>
    </mat-card-title>
    <mat-card-content *ngIf="sessionForm">
      <form
        class="mt2"
        fxLayout="column"
        [formGroup]="sessionForm"
        (ngSubmit)="submit()"
      >
        <mat-form-field appearance="outline" class="" fxFlex>
          <mat-label>Name</mat-label>
          <input matInput formControlName="name" />
          <mat-error *ngIf="sessionForm.get('name')?.hasError('required')">
            Name is required
          </mat-error>
        </mat-form-field>
        <mat-form-field appearance="outline" fxFlex>
          <mat-label>Date</mat-label>
          <input matInput type="date" formControlName="date" />
          <mat-error *ngIf="sessionForm.get('date')?.hasError('required')">
            Date is required
          </mat-error>
        </mat-form-field>
        <mat-form-field appearance="outline">
          <mat-label>Teacher</mat-label>
          <mat-select ngDefaultControl formControlName="teacher_id">
            <mat-option
              *ngFor="let teacher of teachers$ | async"
              [value]="teacher.id"
            >
              {{ teacher.firstName }} {{ teacher.lastName }}
            </mat-option>
          </mat-select>
          <mat-error
            *ngIf="sessionForm.get('teacher_id')?.hasError('required')"
          >
            Teacher is required
          </mat-error>
        </mat-form-field>
        <mat-form-field appearance="outline" fxFlex>
          <mat-label>Description</mat-label>
          <textarea matInput rows="8" formControlName="description"></textarea>
          <mat-error
            *ngIf="sessionForm.get('description')?.hasError('required')"
          >
            Description is required
          </mat-error>
        </mat-form-field>
        <div fxLayout="row" fxLayoutAlign="center center">
          <button
            mat-raised-button
            color="primary"
            type="submit"
            [disabled]="sessionForm.invalid"
          >
            Save
          </button>
        </div>
      </form>
    </mat-card-content>
  </mat-card>
</div>

